INSERT INTO `v1_0b0294c996d9a0bcebb64f535bf39cdc49691fbc4d2de478dc4e02aeb389d8c0` VALUES (125801, 1, 40011, 24001, "もうすぐ、みなさまに\nお会いできるのですね。\n胸が高鳴ってしまいます……\n", "リリ", 2, 0, 1, 1, 321);
INSERT INTO `v1_0b0294c996d9a0bcebb64f535bf39cdc49691fbc4d2de478dc4e02aeb389d8c0` VALUES (126001, 2, 40011, 24001, "初めまして、クリアです♪\nみなさんと一緒に冒険するの\nとっても楽しみにしてます", "クリア", 2, 0, 1, 1, 322);
INSERT INTO `v1_0b0294c996d9a0bcebb64f535bf39cdc49691fbc4d2de478dc4e02aeb389d8c0` VALUES (126101, 3, 40011, 24001, "んーと。\nこれ、あげる。\nはい", "プレシア", 2, 0, 1, 1, 323);
INSERT INTO `v1_0b0294c996d9a0bcebb64f535bf39cdc49691fbc4d2de478dc4e02aeb389d8c0` VALUES (125801, 4, 40011, 24001, "あらためまして……\n【アルターメイデン】の\nギルドマスター、リリと申します", "リリ", 2, 0, 2, 1, 324);
INSERT INTO `v1_0b0294c996d9a0bcebb64f535bf39cdc49691fbc4d2de478dc4e02aeb389d8c0` VALUES (126001, 5, 40011, 24001, "こんにちは、お兄さん♪\n【アルターメイデン】の\nクリアです", "クリア", 2, 0, 2, 1, 325);
INSERT INTO `v1_0b0294c996d9a0bcebb64f535bf39cdc49691fbc4d2de478dc4e02aeb389d8c0` VALUES (126101, 6, 40011, 24001, "お兄。\nきてくれて、うれしい", "プレシア", 2, 0, 2, 1, 326);
